const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(

  <React.StrictMode>
    <App />
  </React.StrictMode>,
);
function Home() {
  return (
    <div>
      <h1>Home route </h1>
    </div>
  )
}

function Learn() {
  return (
    <div>
